Like its 1969 second volume THROUGH THE PAST DARKLY, BIG HITS (HIGH TIDE &amp; GREEN GRASS) is a fine collection of '60s Stones classics, but it's a rather bluesier one. This is exemplified by such rootsy tracks as the redefined Buddy Holly tune &quot;Not Fade Away&quot; and the R&amp;B bounce of Bobby Womack's &quot;It's All Over Now.&quot; 

Not that the group's original songs were lacking in grit or attitude; the vituperative &quot;Get Off My Cloud,&quot; delivered in Mick Jagger's best Sidcup dialect still sounds magnificent, as does Brian Jones's booming Vox pearl guitar on &quot;The Last Time&quot; and Keith Richards's opening chords to the aforementioned &quot;Not Fade Away.&quot; This is a disc to be handed down to your children.


Recorded in London, England, Chicago, Illinois &amp; Hollywood, California between 
1963 &amp; 1966.-


